import React from 'react'
import { Redirect } from 'react-router-dom'


const MyButton = (props)=>{
    return(

    <button onClick={() => {<Redirect to='/IELTSAcademic'/>; alert('the alert is working')}}>{props.name}</button>

    )

}

export default MyButton
